import React from 'react';

function BestPracticeCard({ title, description }) {
  return (
    <div className="card" style={{border: '1px solid #ccc', borderRadius: '8px', padding: '16px', margin: '8px', minWidth: '250px', background: '#f9f9f9'}}>
      <h2 style={{fontSize: '1.2em', marginBottom: '8px'}}>{title}</h2>
      <p style={{fontSize: '1em'}}>{description}</p>
    </div>
  );
}

export default BestPracticeCard;
